import React, { useState } from 'react';
import axios from 'axios';

function SchoolForm() {
  const [formData, setFormData] = useState({
    schoolName: '',
    studentName: '',
    studentClass: '',
    dropoutReason: '',
    age: '',
    caste: '',
    schoolArea: '',
    schoolDistrict: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:3002/api/submitStudentData', formData); // Update the API endpoint URL
      alert('Data submitted successfully.'); // Display an alert on success
      setFormData({
        schoolName: '',
        studentName: '',
        studentClass: '',
        dropoutReason: '',
        age: '',
        caste: '',
        schoolArea: '',
        schoolDistrict: '',
      });
    } catch (error) {
      console.error(error);
      alert('Error submitting data.');
    }
  };

  return (
    <div  className="school-form-container">
      <h2>School Portal</h2>
      
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="schoolName">School Name:</label>
          <input
            type="text"
            id="schoolName"
            name="schoolName"
            value={formData.schoolName}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="studentName">Student Name:</label>
          <input
            type="text"
            id="studentName"
            name="studentName"
            value={formData.studentName}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="studentClass">Student Class:</label>
          <input
            type="text"
            id="studentClass"
            name="studentClass"
            value={formData.studentClass}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="dropoutReason">Dropout Reason:</label>
          <input
            type="text"
            id="dropoutReason"
            name="dropoutReason"
            value={formData.dropoutReason}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="age">Age:</label>
          <input
            type="text"
            id="age"
            name="age"
            value={formData.age}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="caste">Caste:</label>
          <input
            type="text"
            id="caste"
            name="caste"
            value={formData.caste}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="schoolArea">School Area:</label>
          <input
            type="text"
            id="schoolArea"
            name="schoolArea"
            value={formData.schoolArea}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="schoolDistrict">School District:</label>
          <input
            type="text"
            id="schoolDistrict"
            name="schoolDistrict"
            value={formData.schoolDistrict}
            onChange={handleChange}
          />
        </div>
        <button type="submit">Submit</button>
      </form>

   
    </div>
  );
}

export default SchoolForm;
